import React from 'react';

const Logins=(props)=>{

    const {email,setEmail,password,setPassword,handleLogin,handleSignup,
        hasAccount,setHasAccount,emailError,passwordError}=props;

    return(

        <section className="login">
<div className="loginContainer">

<label>Username</label>
<input type="text" autoFocus required value={email} onChange={(e)=>
setEmail(e.target.value)}/>
<p className="errorMsg">{emailError}</p>
<label>Password</label>
<input type="password" autoFocus required value={password} onChange={(e)=>
setPassword(e.target.value)}/>
<p className="errorMsg">{passwordError}</p>

<div className="btnContainer">

    {
        hasAccount ? (

            <>
            <button>Sign in</button>
            <p>Don't have an account ? <span> Sign Up</span></p>
            </>


        ) : (

            <>
            <button>Sign Up</button>
            <p>Have an account ? <span> Sign in</span></p>
            </>

        )

    }

<button  >
    </button>

</div>




    </div>




            </section>

    );

}

export default Logins;
